import { useNavigate } from "react-router-dom";
import { useSelector } from "react-redux";
const App=()=>{
    const navigate=useNavigate();
    const user=useSelector(state=>(state.userId));
   return <div>
    {!user&&<button class="button" onClick={()=>navigate('/About')}>אודות </button>}
    {!user&&<button class="button" onClick={()=>navigate('/Recipies')}>מתכונים </button>}
    {!user&&<button class="button" onClick={()=>navigate('/About')}>אודות </button>}
    {!user&&<button class="button" onClick={()=>navigate('/ShopingList')}>רשימת קניות</button>}
    {user ? <button class="button" onClick={()=>navigate('/SignUp')}>התנתק</button>:<div><button class="button" onClick={()=>navigate('/LogIn')}>התחברות</button><button class="button" onClick={()=>navigate('/SignIn')}>הרשמה</button></div>}
   </div>
} 
export default App;
